import styled from "styled-components";
import Intro from "./components/Intro";
import NavBar from "./components/NavBar";

const Container = styled.div`
    height: 100vh;
    overflow: hidden;
`

const App = () => {
  return (
    <>
  <Container>
    <NavBar />
    <Intro />
  </Container>
  <Container>
    <Feature />
  </Container>
  </>
  );
};

export default App;
